import Navbar from '../../component/Navbar/Navbar'
import Footer from '../../component/Footer/Footer'
import React from 'react'
import { Carousel } from 'antd';

const contentStyle = {
    height: '160px',
    color: 'white',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#364d79',
};

class Home extends React.Component{
    render() {
        return (
            <div style={{display:'flex', flexDirection:'column'}}>
                <Navbar/>
                <div className={'home-container'} style={{backgroundColor:'#0D0311', width:'100vw', height:'100vh', display:'flex',}}>


                </div>
                <Footer/>
            </div>
        );
    }
}


export default Home
